private boolean endsWithVowel(char s[], int len) {
  if (len == 0)
    return false;
  switch(s[len - 1]) {
    case 'α':
    case 'ε':
    case 'η':
    case 'ι':
    case 'ο':
    case 'υ':
    case 'ω':
      return true;
    default:
      return false;
  }
}

